Aphrodite is an application used to record sex life. You can use Aphrodite to record and manage your sex life, and view and track related data through calendars and statistical charts.

In Aphrodite, you can record every one-time life of yourself (support choosing a partner, location, whether to use protective measures, whether to use props, duration, etc.). For single users who have no sexual partners temporarily, Aphrodite is also very considerate to prepare The function of "masturbation record".

【Main function of product】
- Simple and beautiful UI design;
- Detailed recording function, optional partner, location, whether to use protective measures, whether to use props, duration, whether or not to climax, mood and rating of this sex life, etc.;
- Sex life calendar, you can view the date distribution of sex life in the calendar view;
-Statistical charts, you can view the recorded data related to sex life by week, month, and year;
- Link to Apple Health;
- Support password lock;

Aphrodite offers  yearly and Onetime-Purchase subscriptions. The subscription prices are:

- $19.99/Year
- $27.99/Onetime-Purchase

-You can subscribe to a yearly plan ($19.99 billed once a year)or Onetime-Purchase plan($27.99).The prices are in US dollars. Pricing in other countries may vary and actual charges may be converted to your local currency depending on the country of residence.

-Payment will be charged to iTunes Account at confirmation of purchase.
-Subscriptions automatically renew unless auto-renew is turned off at least 24-hours before the end of the period.
-Account will be charged for renewal within 24-hours prior to the end of the current period, and identify the cost of the renewal.
-Subscriptions may be managed by the user and auto-renewal may be turned off by going to the user's Account Settings after purchase.
-Any unused portion of a free trial period, if offered, will be forfeited when the user purchases a subscription to that publication, where applicable.

Aphrodite has accepted HealthKit and will read your health data with your permission. You can open or close these permissions in Apple Heath as needed;

